import './App.css';
import React from 'react';
import Customer from './components/Customer'

const customer = {
  'name': '홍길동',
  'birthday': '961222',
  'gender': '남자',
  'job': '대학생'
}

class App extends React.Component {
  render() {
    return (
      <Customer
        name={customer.name}
        birthday={customer.birthday}
        gender={customer.gender}
        job={customer.job}
      />
    );
  }

}

export default App;
